import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function AllTreks(){
    return (
        <div className="container my-4">
          <div className="row">
            <div className="col-md-2">
              <img src="trek-image.jpg" alt="Trek Image" className="img-fluid" />
            </div>
            <div className="col-md-8">
              <div
                style={{
                  border: "1px solid #ccc",
                  padding: "20px",
                  borderRadius: "10px"
                }}
              >
                <h2>Raigad Trek</h2>
                <p>Location: Mahad</p>
                <p>Duration: 7 days</p>
                <p>Approx: 37Km</p>
                <p>Grade: Moderate</p>
                <p>Altitude: 12100Ft.</p>
                <a href="book-trek.html" className="btn btn-primary">
                  View Details
                </a>
              </div>
            </div>
          </div>
        </div>
      );
}

export default AllTreks;
